import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHeart, faLaughSquint, faSadCry, faAngry } from "@fortawesome/free-regular-svg-icons";
import { faHeart as solidHeart, faLaughSquint as solidSquint } from "@fortawesome/free-solid-svg-icons";
import { useEffect, useState } from 'react';


const Reacts = () => {

    const [heart, toggleHeart] = useState("reacts ")
    const [filled, toggleFilled] = useState(false)

    useEffect(() => {
        filled ? toggleHeart("reacts heart-color"): toggleHeart("reacts")
    }, filled)

    console.log("filled: ", filled)
    console.log("heart: ", heart)
    return(
        <div className="reacts">
            <FontAwesomeIcon className={heart} icon={faHeart} size="2x" onClick={(e) => toggleFilled(!filled)}/>
            <FontAwesomeIcon className="reacts heart-color" icon={solidHeart} size="2x"/>
            <FontAwesomeIcon className="reacts" icon={faLaughSquint} size="2x"/>
            <FontAwesomeIcon className="reacts laugh-color" icon={solidSquint} size="2x"/>
            <FontAwesomeIcon className="reacts" icon={faSadCry} size="2x"/>
            <FontAwesomeIcon className="reacts" icon={faAngry} size="2x"/>
        </div>
    )
}

export default Reacts
